import React from 'react';

const AddAssetButton = () => {
  const buttonStyle = {
    display: 'flex',
    width: '130px',
    height: '41px',
    padding: '16px',
    justifyContent: 'center',
    alignItems: 'center',
    gap: '16px',
    flexShrink: 0,
    borderRadius: '8px',
    background: '#68C231',
    color: '#fff', // Optional: For text color
    border: 'none', // Optional: For removing default border
    fontSize: '14px', // Optional: For text size
    cursor: 'pointer', // Optional: For pointer cursor on hover
    fontWeight: 'bold', // Optional: For bold text
    textAlign: 'center', // Optional: For centering text
  };

  return (
    <button style={buttonStyle}>
      Add Asset
    </button>
  );
};

export default AddAssetButton;
